import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom";
import '../App.css';
export default function Client_Nav(props) {
    const [mystyle, setMystyle] = useState({});
    let navigate=useNavigate();
    useEffect(() => {
        setMystyle({
            // color: "#3aedff",
            // fontSize: "20px", 
            // marginLeft: "230px",
            // marginTop: "70PX"
        });
    }, []);
    return (
    <div>
        <div className="n">
            <nav className="navs ">
                <Link className="App-link" style={mystyle} to={`/client/shopingCart`}>shopping-cart</Link>
                <Link className="App-link" style={mystyle} to={`/client`}>product list</Link>
                <Link className="App-link" style={mystyle} to={`/Log_Out`}>log out</Link>
            </nav>
            <Outlet />
        </div>
      
    </div>);
}
